‚Ä¢
The trail was bordered with thick forest, with evidence of moose, caribou, wolves and bears along the way. The magnificent view of Mt. Blackburn far off in the distance at the end of the trail allured me like the glimmering Emerald City at the end of the Yellow Brick Road. 
‚Ä¢
Nugget Creek, at a very high run-off, can be impassible. But fortunately, as wet and overcast as it had been, it was feasible to cross. I decided to just keep my already-damp boots on and relished in the ice cold water rushing into my shoes, through my wool socks, calming and soothing my sore, swollen and blistered feet. 
‚Ä¢
Downstream of the creek, we were greeted by dark, shadowed mountains. Just beyond it, we were delighted to find an empty, public cabin (Nugget Cabin), complete with an outhouse, firewood, bunk beds, toilet paper, hanging wire/hooks and a wood stove. We immediately started a fire, hung our boots, socks and tents to dry, and slept VERY warm.
‚Ä¢
‚Ä¢

